import React from 'react';
import { Form } from 'react-bootstrap';

export default function SearchBar() {
  return (
    <div>
      <Form className="form-horizontal">
        <Form.Group>
          <span>
            <Form.Control type="text" className="search-bar" name="reaturantSearch" style={{ width: "50%", height: "35px", borderRadius: "50px" }}>
              <Form.Control></Form.Control>
            </Form.Control >
          </span>
        </Form.Group>
      </Form>
    </div>
  )
}
